import React, { useState } from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from '../components/images/black_x.jpg';

const Passflow = () => {
  const [password, setPassword] = useState(""); // State for password
  const [error, setError] = useState(""); // State for error message

  const handleChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Check if the password is valid
    if (password === "validPassword") { // Replace "validPassword" with the actual valid password
      // Redirect to "/home" if the password is valid
      window.location.href = "/home";
    } else {
      // Show error message if the password is invalid
      setError("Invalid password");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in">
        <a href="/public">
          <img className="cross" height="20px" width="20px" src={cancel} alt="img" />
        </a>
        <div className="nav_1">
          <div className="for-x">
            <div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
          </div>
        </div>
        <div className="down-box">
          <div className="content">
            <h2>Enter Your Password</h2>
            <input
              className="input"
              type="password"
              value={password}
              onChange={handleChange}
              placeholder="Password"
            />
            <button type="submit" className="box_ nex">Next</button>
            {error && <div className="error">{error}</div>}
            <div className="box_">Forgot password?</div>
            <div className="text">Don't have an account? <a href="/create">Sign Up</a></div>
          </div>
          <div />
        </div>
      </div>
    </form>
  );
}

export default Passflow;
